import datetime
import logging
from typing import List, Dict, Optional
from enum import Enum

# Constants
DATE_FORMAT = "%m-%d-%Y"

# Enums
class PublishStatus(Enum):
    DRAFT = "Draft"
    PENDING = "Pending"
    PUBLISHED = "Published"
    FAILED = "Failed"

class FileType(Enum):
    FABS = "FABS"
    DABS = "DABS"
    FPDS = "FPDS"

class UserRole(Enum):
    AGENCY_USER = "Agency User"
    BROKER_USER = "Broker User"
    DEVELOPER = "Developer"
    UI_DESIGNER = "UI Designer"
    DATA_USER = "Data User"
    OWNER = "Owner"
    TESTER = "Tester"
    WEBSITE_USER = "Website User"

# Models
class User:
    def __init__(self, user_id: str, name: str, role: UserRole):
        self.user_id = user_id
        self.name = name
        self.role = role

class Submission:
    def __init__(self, submission_id: str, user: User, file_type: FileType, publish_status: PublishStatus = PublishStatus.DRAFT):
        self.submission_id = submission_id
        self.user = user
        self.file_type = file_type
        self.publish_status = publish_status
        self.created_at = datetime.datetime.now()
        self.updated_at = datetime.datetime.now()

    def update_publish_status(self, status: PublishStatus):
        self.publish_status = status
        self.updated_at = datetime.datetime.now()

class ErrorMessage:
    def __init__(self, code: str, message: str, details: str = ""):
        self.code = code
        self.message = message
        self.details = details

class ValidationRule:
    def __init__(self, rule_id: str, description: str, error_message: ErrorMessage):
        self.rule_id = rule_id
        self.description = description
        self.error_message = error_message

class FileData:
    def __init__(self, file_id: str, file_type: FileType, content: str):
        self.file_id = file_id
        self.file_type = file_type
        self.content = content
        self.uploaded_at = datetime.datetime.now()

class Dashboard:
    def __init__(self):
        self.submissions = []

    def add_submission(self, submission: Submission):
        self.submissions.append(submission)

    def get_submission(self, submission_id: str) -> Optional[Submission]:
        for submission in self.submissions:
            if submission.submission_id == submission_id:
                return submission
        return None

    def update_submission_status(self, submission_id: str, status: PublishStatus):
        submission = self.get_submission(submission_id)
        if submission:
            submission.update_publish_status(status)

# Services
class DataProcessingService:
    @staticmethod
